    <p>{`You can write content using `}<a parentName="p" {...{
        "href": "https://github.github.com/gfm/"
      }}>{`GitHub-flavored Markdown syntax`}</a>{`.`}</p>
    <h2 {...{
      "id": "docker-editions"
    }}>{`Docker Editions`}</h2>
    <ul>
      <li parentName="ul">{`Docker is no longer just a "Container runtime"`}</li>
      <li parentName="ul">{`Dokcer moves fast, it mattes how you install it`}</li>
      <li parentName="ul">{`Docker CE (Community Edtion)`}</li>
      <li parentName="ul">{`Three major types of instlals: Direct, Mac/Win, Cloud`}</li>
      <li parentName="ul">{`Linux(different per distro) (don't use default package)`}</li>
    </ul>
    <h2 {...{
      "id": "general"
    }}>{`General`}</h2>
    <p>{`Image is all the binaries of a container, scripts sources and so on
A Container is a running instance of that image`}</p>
    <h2 {...{
      "id": "intro"
    }}>{`Intro`}</h2>
    <p>{`what is happening in 'docker container run' `}</p>
    <ol>
      <li parentName="ol">{`Looks for that image locally in image chache, doesnt find anything`}</li>
      <li parentName="ol">{`then looks in remote image repository`}</li>
      <li parentName="ol">{`downloads the latest version`}</li>
      <li parentName="ol">{`creates new container absed on that images`}</li>
      <li parentName="ol">{`gices it a virtual IP on a pricate network inside a container`}</li>
      <li parentName="ol">{`opens up port 80 on host and forward to port 80 in contianer`}</li>
      <li parentName="ol">{`starts container by using CMD in dockerfile`}</li>
    </ol>
    <h1 {...{
      "id": "cheatsheet"
    }}>{`Cheatsheet`}</h1>
    <h2 {...{
      "id": "general-1"
    }}>{`General`}</h2>
    <pre><code parentName="pre" {...{}}>{`docker version                                      #shows the version of docker client(CLI) and docker engine (systemd-deamon)
docker info                                         #general info expanded e.g running contianers etc.
docker <managemend command> <command>               #docker cointainer run
docke ps                                            #list all running container. -a list all containers
docker top <container id>                           #list processes inside a running container
ps aux                                              #show processer running inside a docker container too without hiding it
docker container inspect                            #details of the container
docker container stats                              #stats of all container
`}</code></pre>
    <h2 {...{
      "id": "networking"
    }}>{`Networking`}</h2>
    <p><inlineCode parentName="p">{`<bridge(docker0)>`}</inlineCode>{` is the default network that routes to the Host Network Interface`}<br parentName="p"></br>{`
`}<inlineCode parentName="p">{`<host>`}</inlineCode>{` it gains performance by skipping virutal networks but sacrifices security of container model. Basically it is direkt on the Host`}<br parentName="p"></br>{`
`}<inlineCode parentName="p">{`<none>`}</inlineCode>{` is not atached to anything`}</p>
    <pre><code parentName="pre" {...{}}>{`docker network ls                                   #List all docker networks
docker network inspect                              #inspect what we are doing
docker network create --driver                      #create a new network
docker network connect                              #atach a network to a container
docker network disconnect                           #detach a network from a container
`}</code></pre>
    <p>{`Create a new Network using the default `}<inlineCode parentName="p">{`<bridge>`}</inlineCode>{` driver. If we need another driver, we have to specify it with `}<inlineCode parentName="p">{`<--driver>`}</inlineCode></p>
    <pre><code parentName="pre" {...{}}>{`$docker network create my_app_net^C
#list them
$docker network ls
NETWORK ID          NAME                DRIVER              SCOPE
8d2dc7348d3d        bridge              bridge              local
9afc2ba4f278        host                host                local
cd18d7f432a3        my_app_net          bridge              local
a0c8590e5ace        none                null                local

$docker network inspect my_app_net 
[
    {
        "Name": "my_app_net",
        "Id": "cd18d7f432a34a979e9f4ae81b5c0be389cd65760fec4168f32c778ff05594ad",
