        "Ingress": false,
        "ConfigFrom": {
            "Network": ""
        },
        "ConfigOnly": false,
        "Containers": {},
        "Options": {},
        "Labels": {}
    }
]
`}</code></pre>
    <p>{`To run  a container on a specific network we can do this:`}</p>
    <pre><code parentName="pre" {...{}}>{`$docker container run -d --name new_nginx --network my_app_net nginx
444869e57cfbd60d237d7c6e5ce792dfa78626d41546e6528c6c4b9460b05e53
`}</code></pre>
    <p>{`If we inspect our network, we can see this: `}</p>
    <pre><code parentName="pre" {...{}}>{`$docker network inspect my_app_net 
[
    {
        "Name": "my_app_net",
        "Id": "cd18d7f432a34a979e9f4ae81b5c0be389cd65760fec4168f32c778ff05594ad",
