                "IPv6Address": ""
            }
        },__
        "Options": {},
        "Labels": {}
    }
]
`}</code></pre>
    <p>{`If we want to connect an existing container to a network we have to run the following`}</p>
    <pre><code parentName="pre" {...{}}>{`docker network connect <containerid> <networkid>
`}</code></pre>
